package uk.gov.justice.ccr.notepad.result.cache.model;


public class ResultDefinitionSynonym {

    private String word;
    private String synonym;

    public String getWord() {
        return word;
    }

    public final void setWord(String value) {
        word = value;
    }

    public String getSynonym() {
        return synonym;
    }

    public final void setSynonym(String value) {
        synonym = value;
    }
}
